import Contact from './Contact';
import './Navbar.css';

function Navbar() {
    return (
        <div className="navbar">
            <Contact className="bck"></Contact>
            <h1 className='bck'>
                Etib tech
            </h1>
            <h1>
                Login
            </h1>
        </div>
    );
}

export default Navbar;
